sys_variable_value.value:
(function execute(inputs, outputs) {

  //gs.info('cy2: ' + JSON.stringify(JSON.parse(inputs.response_body).data));
  processResponse(inputs.response_body);

  function processResponse(r) {
  	var impSet = new GlideRecord('sys_import_set');
    impSet.initialize();
    impSet.state = 'loading';
    impSet.mode = 'asynchronous';
    impSet.table_name = 'x_404764_crypto_0_crypto_price_import';
    impSet.short_description = 'Scheduled Crypto Currenty Data Import';
    impSet.insert();

    var response = JSON.parse(r)
    for(var i = 0 ; i < response.length; i++) {
      var row = response.data[i];
      var impSetRow = new GlideRecord('x_404764_crypto_0_crypto_price_import');
      impSetRow.sys_import_state = 'pending';
      impSetRow.sys_import_set = impSet.getUniqueValue();

      impSetRow.name = row.name;
      impSetRow.id = row.id;
      impSetRow.symbol = row.symbol;
      impSetRow.slug = row.slug;
      impSetRow.num_market_pairs = row.num_market_pairs;
      impSetRow.cmc_rank = row.cmc_rank;
      impSetRow.max_supply = row.max_supply;
      impSetRow.platform = row.platform;
      //impSetRow.price = row['quote']['usd']['price'];
      impSetRow.insert();
    }
    impSet.state = 'loaded';
    impSet.update();

    new GlideImportSetTransformer().transformAllMaps(impSet);

  }
})(inputs, outputs);

